import React, { useEffect, useState } from 'react';

const CoinPrice = () => {

    const [coins,getCoin] = useState([]);


    useEffect(()=>{


    fetch('https://api.upbit.com/v1/market/all')
    .then(res => res.json())
    .then(async res => {
            await getCoin(res);
    })

    },[])

    return(
       <ul>
           {coins.map(coin => <li>{coin.korean_name}</li>)}
       </ul>
    )

}

export default CoinPrice;
